import React, { Component } from 'react';
import ComponentsSidebar from '../shared/ComponentsSidebar';
import DatePicker from 'react-datepicker';
import "react-datepicker/dist/react-datepicker.css";
import { useState } from 'react';
import { Button } from 'react-bootstrap';

class DossierMedical extends Component {
    constructor(props) {
        super(props);
        this.state = { value: '' };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({ value: event.target.value });
    }

    handleSubmit(event) {
        alert('A name was submitted: ' + this.state.value);
        event.preventDefault();
    }

    render() {
        return (
            <div>
                <div className="container d-flex p-md-0">
                    <ComponentsSidebar />
                    <div className="az-content-body pd-lg-l-40 d-flex flex-column">
                        <div className="az-content-breadcrumb">
                            <span>Patient</span>
                            <span>Dossier Medicale</span>
                        </div>
                        <h2 className="az-content-title">Dossier Medicale</h2>
                        <h3>Entrer la date de naissance</h3>
                        <div className="wd-200 mg-b-20">
                            <div className="input-group">
                                <div className="input-group-prepend">
                                    <div className="input-group-text">
                                        <i className="typcn typcn-calendar-outline tx-24 lh--9 op-6"></i>
                                    </div>
                                </div>
                                <DefaultDatepicker />
                            </div>
                        </div>{/* wd-200 */}
                        <div className="row row-xs wd-xl-80p">
                            <div className="col-sm-6 col-md-3"><Button variant="primary btn-block">OK</Button></div>
                        </div>{/* row */}
                    </div>
                </div>
            </div>
        );
    }
}


const DefaultDatepicker = () => {
    const [startDate, setStartDate] = useState(new Date());
    return (
        <DatePicker selected={startDate} onChange={date => setStartDate(date)} className="form-control" style={{ 'z-index': 3 }} />
    );
};

export default DossierMedical;
